import React from "react";
import { UnlockOutlined , UserOutlined, SolutionOutlined } from '@ant-design/icons';

import { Steps } from "antd";

const Stepper_code = () => (
    <Steps className="stepper"
    current={0}
      items={[
        {
          title: 'Account info',
        
          icon: <UnlockOutlined  />,
        },
        {
          title: 'personal Info',
          
          icon: <UserOutlined  />,
        },
        {
          title: 'Images',
         
        
        },
        {
          title: 'finish',

          icon: <SmileOutlined />,
        },
      ]}
    />
  );
  export default Stepper_code;
